import React from "react";

function Home() {
  return (
    <div>
    <div class="jumbotron jumbotron-fluid wrapper">
  <div class="container">
    <h1 class="display-6">Pupster</h1>
    <p class="lead">There Good Boys and Girls</p>
    </div>

    </div>
    <div role="img" aria-label="click item" class="click-item" style="background-image: url(&quot;/assets/images/mr.png&quot;);"></div>
  </div>
  );
}

export default Home;
